export const openCountryModal = modalCountry => {
  return dispatch => {
    dispatch({ type: "OPEN_COUNTRY_MODAL", modalCountry: modalCountry })
  }
}

export const closeCountryModal = () => {
  return dispatch => {
    dispatch({ type: "CLOSE_COUNTRY_MODAL" })
  }
}
